MUTATIONS[2628] = `mutation mutation2628 { createUserMeta(data: {oldId:"16163",user:{connect:{oldId:"739"}},metaType:"",metaName:"scDescription",metaValue:"Requests%3A%20info@triggernslide.com%20%0ABookings%3A%20kowsky@overpins.com%20%0AHybridLive%3A@Overpins%0ATech%20House%2C%20Techno%2C%20Minimal%20Producer.%20%0A%0ATrigger%20N%u2019%20Slide%20is%20an%20artist%20who%20can%20never%20be%20pinned%20down%2C%20no%20matter%20the%20timeframe%20or%20time%20signature.%20He%20is%20a%20born%20%26%20raised%20artist%20from%20Piraeus%2C%20Greece%20and%20his%20DJ%20sets%20or%20productions%20breed%20a%20rare%20feel%20of%20mystique%20and%20discovery.%20Tech%20House%20Groove%20and%20Ambient%20Techno%20Feelings%20Transformed%20into%20Dance%20Music...%20%0A%0A%5C%22I%27m%20really%20into%20finding%20a%20line%20between%20analog%20and%20digital%20sounds%2C%20plus%20i%u2019m%20travelling%20inside%20the%20electronica%20genres%20with%20my%20mind%20focused%20on%20House.%20My%20influences%20come%20from%20a%20life%20spent%20on%20various%20music%20genres%20and%20difficult%20times%2C%20which%20plays%20a%20huge%20role%20in%20the%20way%20that%20i%20connect%20with%20music.%5C%22%20%0A%0AVocals%20are%20playing%20a%20huge%20part%20in%20Trigger%20N%u2019%20Slide%20productions%20as%20long%20as%20there%20is%20something%20that%20needs%20to%20be%20said.%20Basically%20the%20main%20thing%20is%20the%20Bass%20that%20he%20trusts%20on.%20Groove%20is%20the%20main%20thing%20here%20and%20a%20pleasant%20journey%20through%20music%20is%20his%20gold.%20%0A%0A%u201CI%20usually%20write%20the%20lyrics%20and%20the%20only%20thing%20that%20remains%20consistent%20is%20the%20element%20of%20surprise%20in%20my%20productions%u201D.%20%0A%0A2013%3A%20Trigger%20N%u2019%20Slide%20revealed%20his%20debut%20single%20via%20Mahayana%20Records%2C%20%u201CWinter%20Blues%u201D%20a%20darkly-tinged%2C%20transportive%20deep%20house%20track%20that%20curiously%20combines%20natural%2C%20organic%20sounds%2C%20and%20modern%20electronic%20indie%20grace.%20%0A%0A2013%3A%20Trigger%20N%u2019%20Slide%20also%20released%20%u201CFirst%20Time%u201D%20via%20Mahayana%20Records%20and%20was%20his%20first%20hit%2C%20an%20all%20around%20track%20that%20dj%20play%20at%2002%3A00%20at%20night%20on%20any%20club%20and%20in%20the%20evening%20at%20any%20given%20beach%20bar%21%20%0A%0A2014%3A%20Trigger%20N%u2019%20Slide%20collaborated%20with%20Gorge%20Soera%20and%20Arethousa%20%28Vocals%29%20to%20create%20the%20massive%20hit%20%u201CNext%20To%20Me%u201D%20that%20is%20still%20playing%20all%20over%20Greece%20and%20worldwide.%20%0A%0A2014%3A%20one%20more%20hit%20was%20about%20to%20explode%20and%20it%20did%2C%20the%20track%20name%20was%20%u201CSummer%20Story%u201D%20released%20via%20FlipSide%20Recordings%20and%20the%20first%20to%20reach%2012.000%20plays%20in%20Soundcloud...%20The%20furure%20looks%20great%20for%20this%20Talented%20Producer.%20%0A%0A2015%3A%20in%20january%20%u201CSilver%20Sky%u201D%20becomes%20an%20Underground%20must%2C%20a%20release%20from%20Catblack.%20Records%20that%20came%20to%20be%201st%20on%20this%20Labels%20Top10%20tracks%20on%20Beatport%21%20Including%20%u201CWings%20Of%20Fear%u201D%20a%20strong%20Deep%20Tech%20track%20%u201CSilver%20Sky%u201D%20simply%20grooved%20on...%20%0A%0AOn%20May%202015%20another%20great%20release%20%u201CAttitude%u201D%20again%20becomes%20Catblack.%20Records%20No1%20selling%20release%20on%20Beatport%20and%20with%20%u201CSilver%20Sky%u201D%20they%20become%20this%20label%u2018s%20most%20popular%20releases%20until%20today...%20%0A%0AAs%20a%20creative%20mind%20always%20in%20motion%2C%20on%202014%20Trigger%20N%27%20Slide%20has%20teamed%20up%20with%20Gorge%20Soera%20on%20Catblack%2C%20a%20record%20label%20dedicated%20to%20expose%20his%20most%20personal%20and%20passionate%20musical%20side.%20Catblack.%20is%20a%20label%20that%20is%20rising%20with%20music%20concentrated%20on%20Deep%20House%2C%20Tech%20House%20and%20Techno%20%28www.catblackrecords.com%29.%20%0A%0AConnect%20with%20Trigger%20N%u2019%20Slide%3A%0Awww.twitter.com/triggernslide%20%0Awww.facebook.com/triggernslide%20%0Awww.triggernslide.com",metaDeleted:false}) { id } } `
    
